const initialState = {
    models: [],
    selectedModelData: {}
}

export default function alarmReducer(state = initialState, action) {
    switch (action.type) {
        case 'RECEIVE_ALL_CARS': {
            return {
                ...state,
                models: action.list.elements
            }
        }
        case 'RECEIVE_MODEL_DATA': {
            return {
                ...state,
                selectedModelData: action.details
            }
        }
        default:{
            return {
                ...state
            }
        }

    }
}
